window.bookSummaryJSON = "<p><b>Discover how to turn every day into a treasured experience through exceptional living.</b> </p> <p>There's an art to success! </p> <p>You don't have to be a super-achiever or unusually creative. You don't have to endure great obstacles. You don't even have to do exceptional things. You just have to do ordinary things exceptionally well. </p> <p><i>The Art of Exceptional Living</i> by Jim Rohn is the can't-miss guide that shows you how to begin living life according to your own rules. Catch up on your success and attain all you want and need. Let success expert Jim Rohn teach you how to master the art of living exceptionally well! </p> <p>Jim will teach you the importance of self-education, developing new skills, and how to start your own personal success library filled with information that will make you more knowledgeable as well as more employable. You owe it to yourself to experience the wisdom of Jim Rohn. </p> <p>Jim Rohn is credited with inspiring and teaching the likes of Anthony Robbins, Les Brown, and countless others various success principles in the areas of financial independence, education, relationships, and much more! </p>"; 
